float current[]={0.0,0.0,0.0};



void output(int x, int y, float r, float g, float b, int font, char *string)
{
  //glColor3f( r, g, b );
  glRasterPos2f(x, y);
  int len, i;
  len = (int)strlen(string);
  for (i = 0; i < len; i++) {
    glutBitmapCharacter(GLUT_BITMAP_TIMES_ROMAN_24, string[i]);
  }
}

int codeslno;

void sel_clr(int curx, int cury)
{

	float ra;
    int x=960.0;
	int y=540.0;
	int i,j;
	cury=glutGet(GLUT_WINDOW_HEIGHT)-cury;
	glColor3f(1.0,1.0,0.0);
    if(curx>=x && cury>=y && curx-960>=cury-540)
    {
        ra=(curx-x)*(curx-x)+(cury-y)*(cury-y);
        ra=sqrt(ra);
        for(i=0;i<16;i++)
		if(ra>=sel[i][0] && ra<=sel[i][1])
        {
			current[0]=oct_clr[i][0];
            current[1]=oct_clr[i][1];
            current[2]=oct_clr[i][2];
            codeslno=i;
			glutPostRedisplay();
        }
    }
}

void display()
{
    glClear(GL_COLOR_BUFFER_BIT);

    mydrawpalette();

    glColor3fv(current);

    glBegin(GL_POLYGON);
        glVertex2f(100,100);
        glVertex2f(100,200);
        glVertex2f(200,200);
        glVertex2f(200,100);
    glEnd();
    output(50,50,1.0,1.0,0.0,0,code[codeslno]);



    /*for(i=0;i<glutGet(GLUT_WINDOW_WIDTH);i++)
        for(j=0;j<glutGet(GLUT_WINDOW_HEIGHT);j++)
    {
        if(i>=x && j>=y && i-960<j-540)
        {
            ra=(i-x)*(i-x)+(j-y)*(j-y);
            ra=sqrt(ra);
            if(ra>=100 && ra<=125)
                {
					mydraw(i,j);
                }
        }
    }*/


	glFlush();
}

void myMouse(int button,int state,int x,int y)
{
    if(button==GLUT_LEFT_BUTTON&&state==GLUT_DOWN)
        sel_clr(x,y);
    if(button==GLUT_RIGHT_BUTTON&&state==GLUT_DOWN)
        exit(0);
}

